street:
Минское шоссе с платной трассой и другие. Также в пешей доступности находятся две ж/д станции — "Жаворонки" и "Здравница". Дорога на электропоезде до делового центра "Москва-Сити" составит всего 35 минут.

Особенности ЖК:

- Малоэтажная застройка: 4-6 этажей;
- Благоустроенный пешеходный бульвар;
- Пространства для отдыха и спорта;
- Квартиры с террасами на последних этажах;
- Квартиры с отдельным входом на первых этажах;
- Внутренняя территория квартала свободна от машин;
- Безбарьерная среда;
- Помещения для хранения детских колясок и спортивного инвентаря.

